mapper.select:
select 

from ASN_HDR
where WORK_CENTER = #{workCenter,jdbcType=NVARCHAR}
  and STORER_ID = #{storerId,jdbcType=NVARCHAR}
  and ASN_ID = #{asnId,jdbcType=NVARCHAR}

mapper.delete:
delete from ASN_HDR
where WORK_CENTER = #{workCenter,jdbcType=NVARCHAR}
  and STORER_ID = #{storerId,jdbcType=NVARCHAR}
  and ASN_ID = #{asnId,jdbcType=NVARCHAR}
